import React, { Component } from "react";
import { Row, Col } from "antd";
import SideMenu from "./sideMenu";

class AppContent extends Component {
  state = {
    sideMenuHeight: "80vh",
    sideMenuWidth: "100%"
  };
  render() {
    return (
      <Row>
        <Col span={3}>
          <div
            style={{
              position: "fixed",
              zIndex: 1,
              marginTop: 50,
              overflow: "auto",
              width: "12.5%"
            }}
          >
            <SideMenu height={this.state.sideMenuHeight} />
          </div>
        </Col>
      </Row>
    );
  }
}

export default AppContent;
